    const [employeeCount, setEmployeeCount] = useState(0);
    const [speed, setSpeed] = useState(0);

    return (
        <EmployeeContext.Provider value={{ employeeCount, setEmployeeCount}}>
            {children}
        </EmployeeContext.Provider>
    );
};
